Defendant Jaqwaun D Winston in court with attorney Terese M Dick.  Defendant Jaqwaun D Winston in custody.  Kimberly D Schoepp appeared for the State of Wisconsin.  Plea hearing proceeds.  Defendant was advised of constitutional rights and maximum penalties, and further advised that if not a United States citizen deportation is possible. Defendant sworn, examined as to plea, and entered a plea of guilty.  Court found defendant freely, voluntarily and intelligently waived all constitutional rights. Plea questionnaire waiver of rights and addendum to plea questionnaire received and filed. Parties stipulated to the criminal complaint as factual basis to sustain defendant's plea. Court found defendant guilty as charged in the Information and ordered a Judgment of Conviction be entered into the record.  The Court advised defendant that as a convicted felon not to possess any firearms. Court further advised defendant of voting ineligibility.   

Statements by the State, defense and defendant.:  The Court imposed the following sentence:
Defendant's TOTAL LENGTH OF SENTENCE shall be 2 years.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for one (1) year with credit for 75 days time served.  Defendant shall serve one (1) years on EXTENDED SUPERVISION.    The defendant is eligible for the Challenge Incarceration Program AND for the Wisconsin Substance Abuse Program.  The Court advised the defendant of his determinate sentence pursuant to statute and in accordance with Form CR-234.  Copy provided to defendant. The Court STAYED THE SENTENCE and placed the defendant on probation to the State Department of Corrections for a period of three (3) years.
 * Court ordered defendant to provide a DNA sample.

CONDITIONS OF PROBATION (and Extended Supervision, if revoked):
 - No controlled substances or alcohol;
 - AODA assessment and treatment;
 - Urine screens;
 - No contact with the victim Tamara K.;
 - Obtain high school diploma, HSED or GED;
 - No contact with co-actor Kamari Hudson;
 - Be given arenting counseling;
 - Seek and maintain employment;
 - Be given job and vocational training;
 - Be given cognitive thinking intervention counseling;
 - Serve 8 months condition time at the House of Correction, with Huber for work and school; also, release to the Day Reporting Center.  NO good time.  
 - Pay DNA surcharge, court costs, disbursements, as well as restitution (to be determined at a later hearing).  Should defendant be revoked and sent to prison, Court ordered taken monies taken from prison funds not to exceed 25%.  Balance to be paid while on extended supervision.

Court ordered case continued before Branch 20. 

